import React from "react";
import PopupWithForm from "./PopupWithForm";

function DeleteCardPopup({ isOpen, onClose, onSubmit }) {
    function handleSubmit(e) {
        e.preventDefault();
        onSubmit();
    }
    return (
        <PopupWithForm
            isOpen={isOpen}
            onClose={onClose}
            onSubmit={handleSubmit}
            name="delete-card"
            title="Вы уверены?"
            button="Да"/>
    )
};

export default DeleteCardPopup;
